            Map<String, Set<Long>> beXTablets, String tabletId, Tablet tablet) {
        int tabletCount = Integer.MAX_VALUE;
        String currentBeNode = "";
        // Allocate tablets equally for all BeNodes
        for (String beNode : tablet.getRouting()) {
